import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import Menu from './components/Menu';
import Login from './components/Login';  // Add this import
import Booking from './components/Booking';  // Add this import
import Footer from './components/Footer';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/menu" element={<Menu />} />
        <Route path="/login" element={<Login />} />  {/* Add route for Login */}
        <Route path="/booking" element={<Booking />} />  {/* Add route for Booking */}
      </Routes>
      <Footer />
    </Router>
  );
}

export default App;
